import React from "react";

function Profile() {
  return (
    <div
      style={{
        width: "100%",
        display: "flex",
        overflow: "auto",
        minHeight: "100vh",
        alignItems: "center",
        flexDirection: "column",
        justifyContent: "flex-start",
      }}
    >
      <div
        style={{
          display: "flex",
          width: "100%",
          height: "100px",
          border: "2px dashed rgba(120, 120, 120, 0.4)",
          alignItems: "flex-start",
          flex: "0 0 auto",
        }}
      ></div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          width: "700px",
          height: "537px",
          alignItems: "center",
          justifyContent: "flex-start",
        }}
      >
        <h1
          style={{
            height: "66px",
          }}
        >
          Login Page
        </h1>
        <form
          style={{
            width: "602px",
            height: "301px",
            display: "flex",
            flexDirection: "column",
            justifyContent: "flex-start",
            alignItems: "center",
          }}
        >
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              width: "414px",
              height: "50%",
              alignItems: "flex-start",
              flex: "0 0 auto",
            }}
          >
            <input
              type="text"
              placeholder="username"
              style={{
                height: "82px",
                width: "410px",
              }}
            />
            <input
              type="password"
              placeholder="password"
              style={{
                height: "82px",
                width: "410px",
              }}
            />
          </div>
          <div
            style={{
              display: "flex",
              width: "410px",
              height: "194px",
              alignItems: "flex-start",
              paddingTop: "39px",
            }}
          >
            <button type="button">Login</button>
            <button type="button">Register</button>
          </div>
        </form>
      </div>
      <div
        style={{
          display: "flex",
          width: "100%",
          height: "147px",
          border: "2px dashed rgba(120, 120, 120, 0.4)",
          alignItems: "flex-start",
        }}
      ></div>
    </div>
  );
}

export default Profile;
